import './App.css';
import React, { Component, Fragment } from 'react';

class App extends React.Component{
  constructor(props){
    super(props)
  }

render(){
  return (
    <Fragment>
      <div className='container col-md-6 mt-3'>
          <div className='card'>
              <div className='card-head text-center'>
                <p>helooooo im rose</p>
              </div>
              <div className='card-body'>
                  <p>im body</p>
              </div>
          </div>
      </div>
    </Fragment>
  )
}
}

export default App;
